import React from 'react';

const Burger =({ burgers }) => {
  const renderBurgers = burgers.map(burger =>
    <li key={burger.id}>{burger.name}-{burger.price}-{burger.description}-{burger.status}</li>
    )

    return (
      <ul  className='burgers'>
        {renderBurgers}
      </ul>
    )
}

export default Burger;
